import { Button, TextField } from "@mui/material";
import React, {useState} from "react";
import styled from 'styled-components'

export default function Todo() {
    const [count, setTodo] = useState('')
    return (<TodoDiv>
        <h1>todo 페이지</h1>
        <p>할 일: {count}</p>
        <TextField id="outlined-basic" label="Outlined" variant="outlined" />
        <Button variant="outlined" onClick={() => setTodo(count + document.getElementById('outlined-basic').value)}>추가</Button>
        {/* <Button variant="outlined" onClick={() => setTodo(count - 1)}>삭제</Button> */}
        <Button variant="outlined" onClick={() => console.log(document.getElementById('outlined-basic').value)}>확인</Button>
    </TodoDiv>)
}

const TodoDiv = styled.div` text-align: center; `
